import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';

export default function Contact() {
  return (
    <div className="bg-base-100 about py-20 px-36 flex flex-col items-center">
      {/* Title */}
      <h1 className="text-5xl font-bold p-2 mb-10 rounded-lg inline-block bg-accent">
        Contact Me
      </h1>
      <p className="text-2xl">Feel free to contact or connect with me! </p>
      <div className="flex flex-row items-center mt-8 space-x-8">
        {/* Email icon with tooltip */}
        <div className="lg:tooltip tooltip-top" data-tip="hello">
            <a>
                <FontAwesomeIcon icon={faEnvelope} className="text-3xl" />
            </a>
        </div>

        {/* LinkedIn icon with tooltip */}
        <div className="lg:tooltip tooltip-top" data-tip="hello">
          <a href=''></a><FontAwesomeIcon icon={faLinkedin} className="text-3xl" />
        </div>


        {/* GitHub icon with tooltip */}
        <div className="lg:tooltip tooltip-top" data-tip="hello">
          <a href='https://google.com'>
            <FontAwesomeIcon icon={faGithub} className="text-3xl" />
            </a>
        </div>

      </div>
    </div>
  );
}
